const styleList = {
    textAligs: 'right'
}

function TodoList(props){ // En react cuando escribimos una funcion(componente) en lo que antes era parametros, ahora en react se llaman props y son las cualidades que posee la funcion para despues ejecutarlas con los elementos del componente
    return(
        props.children (style={styleList}) // Este es el componente por el cual todo lo que este devuleva seran los hijos de otro elemento
    )
}
export {TodoList}
